import { Link } from "react-router-dom";



function Navbar()  { 
return (  
    <nav className="bg-blue-400 flex justify-between">
<h1>Navbar Component </h1>

<div> 
<Link classNameto ="/"> Home </Link> 
<Link to ="/about"> About </Link> 
</div>
 </nav> ) ; 


}

 export default Navbar ;
